import React from "react";
import style from "./Images.css"; 

function Images({ images }) {
 
  return (
    <div className="container">
      <div className="row">
        {images.map(
          (image, index) =>
           
            index < 9 && (
              <div className="col-md-4 mb-4">
                <img
                  src={image.url}
                  alt={image.alt || "Image"}
                  className="img-fluid image-style"
                />
              </div>
            )
        )}
      </div>
    </div>
  );
}

export default Images;
